let myMap = new Map([['name','ren'],['age',12]]); // Map
console.log(myMap);  //{'name'=>'ren','age'=>12}
myMap.set('sex','male'); // map
console.log(myMap);  //{'name'=>'ren','age'=>12,'sex'=>'male'}
myMap.get('name');  //'ren' key
myMap.has('age');  //true 
myMap.delete('age');  //  Map true
myMap.has('age');  //false
myMap.get('age');  //undefined
